from kandinsky import set_pixel, fill_rect

w, h = 320, 240
colors = [(251, 251, 251), (250, 248, 248), (248, 248, 249), (248, 248, 248), (248, 248, 247), (247, 248, 248), (248, 247, 247), (247, 247, 247), (247, 247, 246), (246, 247, 247), (246, 246, 246), (192, 156, 138), (161, 103, 73), (105, 74, 61), (105, 28, 41), (17, 20, 30)]
dominant_color = (17, 20, 30)
dominant = 15
rle_data = ''

import part_1
import part_2
import part_3
rle_data= part_1.returns()  + part_2.returns() + part_3.returns() + rle_data
def decode_rle_and_draw(data, colors, dominant):
  fill_rect(0, 0, w, h, dominant_color)
  i = 0
  p = 0  # pixel counter
  while i < len(data):
    if data[i] == 'x':
      i += 1
      n = ''
      while i < len(data) and data[i].isdigit():
        n += data[i]
        i += 1
      skip_count = int(n)
      p += skip_count  # skip those pixels
    else:
      color_index = int(data[i], 16)
      x = p % w
      y = p // w
      set_pixel(x, y, colors[color_index])
      p += 1
      i += 1

